import { Link } from "react-router-dom";

const Home = () => {
     const {user} = "";

  return 
  user?(
    <div className="home">
      <div className="home_body shadow">
         
      </div>
    </div>
  ):
  (
      <div className="home">
          <div className="login_body shadow">
              
          </div>
      </div>
  );
};

export default Home;
